import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import myPhoto from './img/3.jpg'; // Import your photo file
import Logo from './img/Logo.png';

const LoginPage = () => {
  const [formData, setFormData] = useState({
    email: '',
    password: ''
  });

  const [error, setError] = useState('');

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    
    if (formData.email === 'Evendango@gmail.com' && formData.password === '123456') {
      window.location.href = '/home';
    } else {
      setError('Email or password is incorrect');
    }
  };

  return (
    <>
     <nav className=" md:flex flex-col md:flex-row md:space-x-2 p-2 space-x-0 md:space-y-0 fixed w-full top-0 z-10  bg-gray-200">
        <div className="container mx-auto flex flex-col md:flex-row md:justify-between md:items-center">
          <div className="flex justify-between items-center w-full md:w-auto ">
          <img className="object-cover " src={Logo} alt="Profile" />
          
          </div>
        </div>
      </nav>
     
    <div className="flex-shrink-0 w-96 h-full relative overflow-hidden bg-white pt-24">
      <div className="absolute inset-0 "></div>
    </div>
    <div className="max-w-md w-full">
      <div className="mb-8">
        <Link to="/login" className="text-red-400 text-2xl font-extrabold md:mb-0 mb-4">Even<span className="text-yellow-500">D</span>ango</Link>
        <p className="text-gray-600 flex justify-end">
          New User?{' '}
          <Link className="text-green-800 hover:underline pl-4" to="/register">
            Sign Up
          </Link>
        </p>
      </div>
      <div>
        <h2 className="mt-6 text-center text-3xl font-extrabold text-yellow-500">
          Welcome !
        </h2>
        <p className="mt-2 text-center text-sm text-gray-600 font-semibold">
          Login to continue
        </p>
      </div>
      <form className="mt-8 space-y-4 w-full" onSubmit={handleSubmit}>
        <input type="hidden" name="remember" value="true" />
        <div className="rounded-md shadow-sm -space-y-px">
          <div>
            <label htmlFor="email-address" className="sr-only">Email address</label>
            <input
              id="email-address"
              name="email"
              type="email"
              autoComplete="email"
              required
              value={formData.email}
              onChange={handleChange}
              className="appearance-none rounded-none relative block w-full px-3 py-2 border border-gray-300 placeholder-gray-500 text-gray-900 rounded-t-md focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 focus:z-10 sm:text-sm"
              placeholder="Email address"
            />
            {error && <span className="text-red-500 text-xs">{error}</span>}
          </div>
          <div>
            <label htmlFor="password" className="sr-only">Password</label>
            <input
              id="password"
              name="password"
              type="password"
              autoComplete="current-password"
              required
              value={formData.password}
              onChange={handleChange}
              className="appearance-none rounded-none relative block w-full px-3 py-2 border border-gray-300 placeholder-gray-500 text-gray-900 rounded-b-md focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 focus:z-10 sm:text-sm"
              placeholder="Password"
            />
          </div>
        </div>

        <div className="flex items-center justify-between">
          <div className="flex items-center">
            <input
              id="remember-me"
              name="remember-me"
              type="checkbox"
              className="h-4 w-4 text-indigo-600 focus:ring-indigo-500 border-gray-300 rounded"
            />
            <label htmlFor="remember-me" className="ml-2 block text-sm text-gray-900">
              Remember me
            </label>
          </div>

          <div className="text-sm">
            <a href="#" className="font-medium text-red-700 hover:text-green-500">
              Forgot your password?
            </a>
          </div>
        </div>

        <div>
          <button
            type="submit"
            className="group relative flex justify-center py-2 px-4 border border-transparent text-sm font-medium rounded-md text-white bg-indigo-900 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500"
          >
            Login
          </button>
        </div>
      </form>
    </div>



    </>
  );
};

export default LoginPage;
